  let myL=useRef(null)
  let myDu=useRef(null)
  let myA=useRef(null)
  let myI=useRef(null)
const [myuser, setmyuser]=useState([])
  const add=()=>{
    let y=myuser
    axios.put('http://localhost:1234/Users/addUser',myuser).then(l=>{setmyuser(l.data)},alert("Added successfully"))
    debugger
  }
  const check=()=>{
    let a=myN.current
    let b=myD.current
