  //   <input type='text' placeholder='Enter isManger' onChange={(e)=>setmyuser({...myuser,isMnager:e.target.value})}></input>
  //   <input type='text' placeholder='Enter favoriteRecipes' onChange={(e)=>setmyuser({...myuser,favoriteRecipe:e.target.value})}></input>
  //   <div class="col-sm-offset-2 col-sm-10">
  //       <button type="submit" class="btn btn-default" onClick={()=>add()}>Save</button>
  //   </div>
  // </div>
  <div class="container">
  <form class="form-horizontal">
    <div class="form-group">
      <div class="col-sm-8" style={{marginLeft:150}}>
      <input re type='text' class="form-control" placeholder='Enter name' onChange={(e)=>setmyuser({...myuser,name:e.target.value})}></input><br></br>  
      <input type='text' class="form-control" placeholder='Enter id' onChange={(e)=>setmyuser({...myuser,id:e.target.value})}></input><br></br>  
      <input type='text' class="form-control" placeholder='Enter address' onChange={(e)=>setmyuser({...myuser,adress:e.target.value})}></input><br></br>           
      <input type='text' class="form-control" placeholder='Enter phone' onChange={(e)=>setmyuser({...myuser,phone:e.target.value})}></input><br></br>           
      <input type='text' class="form-control" placeholder='Enter isManger' onChange={(e)=>setmyuser({...myuser,isMnager:e.target.value})}></input><br></br>           
      <input type='text' class="form-control" placeholder='Enter favoriteRecipes' onChange={(e)=>setmyuser({...myuser,favoriteRecipe:e.target.value})}></input><br></br>         
      <div class="col-sm-offset-5 col-sm-10">
        <button type="submit" class="btn btn-default" onClick={()=>check()}>Save</button>
      </div>
      </div>
    </div>
  </form>
</div>
  )
}

export default SignOnJ
